import React from 'react';

const mainDiv={
    height: '90vh',
    backgroundColor: '#cfcfcf',
}

const mainTitle={
    fontSize: '3vw',
    fontFamily: 'Roboto Mono',
    fontWeight: 500,
}

class LandingPage extends React.Component{
    render(){
        return(
            <div style={mainDiv}>
                <div style={mainTitle}>
                    Hi, I'm Paridhi!
                </div>
                <div>
                    I develop websites and mobile apps. I also design! 
                </div>
            </div>
        );
    }
}

export default LandingPage;
